import DefaultLayout from "~/Layout/DefaultLayout";
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Home from "~/pages/Home";

function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <Routes>
            <Route path="/" element={
              <DefaultLayout>
                <Home />
              </DefaultLayout>
            } />
            <Route path="/product" element={
              <DefaultLayout>
                <p>Sản phẩm</p>
              </DefaultLayout>
            } />
        </Routes>
      </div>
    </BrowserRouter>
  );
}

export default App;
